import AppBar from '@material-ui/core/AppBar';
import "./styles.scss";
import SearchIcon from "../../../assets/SearchIcon";

import {
    createBill,
    createBillReset,
} from "../../../state/bills/actions";

import {
    searchPatient,
    getPatientSuccess,
} from "../../../state/patients/actions";

import {
    IDispatchProps,
    IStateProps,
    TActivityTransitionState,
    TProps,
    TValues,
} from "./types";
import patientDTO from "../../../mockServer/fixtures/patientDTO";


const NewBillActivity: FunctionComponent<TProps> = ({
    userCredentials,
    isLoading,
    hasSucceeded,
    getMed,
    createBill,
    createBillReset,
    hasFailed,
    billHomeRoute,
}) => {
    const { t } = useTranslation();

    const breadcrumbMap = {
        [t("nav.dashboard")]: "/",
        [t("nav.billing")]: "/billing",
        [t("nav.newbill")]: "/bills",
    };

    //
    //Gestione Modal
    //
    const [open, setOpen] = React.useState(false);
    const handleOpen = () => {
        setOpen(true);
    };
    const handleClose = () => {
        setOpen(false);
    };
    const body = (
        <div>
            <p>ciao</p>
        </div>
    )
    //
    //

    return (
        <div className="new_Bill">
            <AppHeader
                userCredentials={userCredentials}
                breadcrumbMap={breadcrumbMap}
            />
            <div className="newBill__background">
                <div className="newBill__content">
                    <div className="newBill__title">{t("nav.newbill")}</div>
                    <div className="newBill__panel">
                        <div className="table">
                            <div className="container">
                                <form>
                                    <div className="bill_DatePat">
                                        <label>data</label>
                                        <input type="date"></input>
                                        <label>paziente</label>
                                        <input type="text"></input>
                                    </div>
                                </form>
                            </div>
                            <TableContainer component={Paper}>
                                <Table className="bill_Table" size="small" aria-label="a dense table">
                                    <TableHead>
                                        <TableRow>
                                            <TableCell>Dessert (100g serving)</TableCell>
                                            <TableCell align="right">Calories</TableCell>
                                            <TableCell align="right">Fat&nbsp;(g)</TableCell>
                                            <TableCell align="right">Carbs&nbsp;(g)</TableCell>
                                            <TableCell align="right">Protein&nbsp;(g)</TableCell>
                                        </TableRow>
                                    </TableHead>
                                    <TableBody>
                                        {rows.map((row) => (
                                            <TableRow key={row.name}>
                                                <TableCell component="th" scope="row">
                                                    {row.name}
                                                </TableCell>
                                                <TableCell align="right">{row.calories}</TableCell>
                                                <TableCell align="right">{row.fat}</TableCell>
                                                <TableCell align="right">{row.carbs}</TableCell>
                                                <TableCell align="right">{row.protein}</TableCell>
                                            </TableRow>
                                        ))}
                                    </TableBody>
                                </Table>
                            </TableContainer>
                        </div>
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
}


const mapStateToProps = (state: IState): IStateProps => ({
    userCredentials: state.main.authentication.data,
    isLoading: state.bills.createBill.status === "LOADING",
    hasSucceeded: state.bills.createBill.status === "SUCCESS",
    hasFailed: state.bills.createBill.status === "FAIL",
    getMed: state.medicals.medicalsOrderByName.data,
});




const mapDispatchToProps: IDispatchProps = {
    createBill,
    createBillReset,

};

export default connect(mapStateToProps, mapDispatchToProps)(NewBillActivity);
